    22, 2013. This report is being amended to reflect the most up-to-date beginning
    cash on hand balance.  The October 31, 2012 amendment of the August monthly report
    (FEC- 830742) used the ending cash on hand balance from a previous amended report
    instead of the most up-to-date version.  This caused the calculation error on
    Line 8, which has now been corrected. In addition, this report is being amended
    to disclose $56.19 in disbursements on Line 21(b) for bank fees that had been
    inadvertently undisclosed.  The report is also being amended to disclose $3,776.74
    in payroll receipts that had been inadvertently undisclosed. \n"
